import React from "react";

const Stage = () => {
  return (
    <div>
      {/* Description */}
      <div className="cards-1">
        <div className="container">
          <div className="row">
            <div className="col-lg-12">
              {/* Card */}
              <div className="card">
                <span className="fa-stack">
                  <span className="hexagon" />
                  <i className="fas fas-dev fa-binoculars fa-stack-1x" />
                </span>
                <div className="card-body">
                  <h4 className="card-title">Project Analysis</h4>
                  <p>
                    unchanged. It was popularised in the 1960s with the release
                    of Letraset sheets containing Lorem
                  </p>
                </div>
              </div>
              {/* end of card */}
              {/* Card */}
              <div className="card">
                <span className="fa-stack">
                  <span className="hexagon" />
                  <i className="fas fas-dev fa-list-alt fa-stack-1x" />
                </span>
                <div className="card-body">
                  <h4 className="card-title">Development Planning</h4>
                  <p>
                    packages and web page editors now use Lorem Ipsum as their
                    default model text, and a search for 'lorem ipsum' will
                    uncover many web sites still in their infancy.
                  </p>
                </div>
              </div>
              {/* end of card */}
              {/* Card */}
              <div className="card">
                <span className="fa-stack">
                  <span className="hexagon" />
                  <i className="fas fas-dev fa-chart-pie fa-stack-1x" />
                </span>
                <div className="card-body">
                  <h4 className="card-title">Execution &amp; Evaluation</h4>
                  <p>
                    packages and web page editors now use Lorem Ipsum as their
                    default model text, and a search for 'lorem ipsum' will
                    uncover many web sites still in their infancy.
                  </p>
                </div>
              </div>
              {/* end of card */}
            </div>{" "}
            {/* end of col */}
          </div>{" "}
          {/* end of row */}
        </div>{" "}
        {/* end of container */}
      </div>{" "}
      {/* end of cards-1 */}
      {/* end of description */}
    </div>
  );
};

export default Stage;
